# フィットネス

楽しみながらフィットネスをしたいですか？ クイックファイアモードをプレイして、数千の高速シュートをブロックしてみてください。 グローバルリーダーボードでの自分の順位を確認し、週間のフィットネス目標を設定し、トップスコアを目指しながら消費カロリーを追跡してください。

{546884664358871}

# サッカーの練習

重要なセーブをする覚悟は、Set Play Modeでありますか？

{396597523457797}

# 社交

自分が一番だと思っていますか？ マルチプレイヤーモードの2つで友達や他のプレイヤーに挑戦しましょう: Target ClashそしてGoalie Wars。

{3771009146448097}

# スタッツハブ

データに飛び込みたいですか？ロッカールームで詳細なパフォーマンスフィードバックにアクセスし、ギアを強化しましょう。

{871139784522578}

